  }

  // maps a json object with a list of RefundDestinationDetails-objects as value to a dart map
  static Map<String, List<RefundDestinationDetails>> mapListFromJson(dynamic json, {bool growable = false,}) {
    final map = <String, List<RefundDestinationDetails>>{};
    if (json is Map && json.isNotEmpty) {
      // ignore: parameter_assignments
      json = json.cast<String, dynamic>();
      for (final entry in json.entries) {
        map[entry.key] = RefundDestinationDetails.listFromJson(entry.value, growable: growable,);
      }
    }
    return map;
  }

  /// The list of required keys that must be present in a JSON.
  static const requiredKeys = <String>{
    'type',
  };
